import React from "react";
import { Container } from "react-bootstrap";

import { RecipeCard } from "./components/recipes/RecipeCard";

export function App() {
  return (
    <Container>
      <RecipeCard
        recipeData={{
          name: "name",
          information: "infooo",
          link: "hhtttpps",
          ingredients: [
            { name: "ingr1", amount: "15 gr" },
            { name: "ingr2", amount: "15 pcs" },
          ],
        }}
      />
    </Container>
  );
}
